import React, { useState,useEffect } from 'react';
import {STLViewer} from 'react-stl-obj-viewer';
import {IconButton, Collapse, Button } from '@material-ui/core';
import BackspaceIcon from '@material-ui/icons/Backspace';


function STLDisplay(props){

	const [aux, setaux] = useState([]);
	const [button, setbutton] = useState(false);
	const [backColor, setbackColors ] = useState("#b0b0b0");

	useEffect(() => {   
		setaux([props.file])
		setbutton(true)
		//props.setUnavailable()
		// eslint-disable-next-line react-hooks/exhaustive-deps
	},[props.file]);

	function deleteid(){
		//props.setAvailable()
		setaux([])
		setbutton(false)
	}

	function changeit(){
		setbackColors("#f5f50a");
	}

return(
	<div>

		<Collapse in={button}>
			<IconButton color="primary" aria-label="Display" /*onClick={deleteid}*/>
			<BackspaceIcon fontSize="large"/>
			</IconButton>
		</Collapse>

		{aux.map(auxModel=>
			<STLViewer
			key={auxModel.id+256}
			width={800}
			height={380}
			sceneClassName="test-scene"
			file={auxModel}
			className="stl"
			modelColor="#FF0000"
			backgroundColor={backColor}
			/> 
		)
		}

	</div>
)};

export default STLDisplay;
